import './style-editor.css';

function SectionEditor() {
    return (
        <div id="section">
            <div id="section-left">
                <h2 id="header-left">Позиционирование данных</h2>

            </div>
            <div id="section-right">
                <h2 id="haeder-right">Бирка</h2>

            </div>
        </div>
    );
};

export default SectionEditor;
